import React, { Component } from 'react';
import styles from './App.module.scss';
import './App.scss';

import profile_pic from "./assets/jpg/jennifer_portrait.JPG";

class App extends Component {
	constructor(props) {
	  super(props);

	  this.state = {
		user: {
			name: {
				first: "Jennifer",
				last: "Haggerty"
			},
			email: "thejenniferhaggerty@protonmail.com",
			location: "Remote, EST United States",
			website: "https://studiovonjenn.com",
			age: 100,
			pronouns: "She/xe",
			photo: profile_pic,
			quote: "wee :D",
			about: `Jennifer enjoys developing websites and apps that warrant repeat visits through their accessibility
			and ease of use in frontend development.`,
			likeToMeet: `I'd like to meet people interested in video games, home improvement, and talking code.`,
			interests: [
				{general: `Dogs, painting, costume making, blacksmithing, immersive conventions and events.`},
				{music: `Metal, medieval, goth, synthwave.`},
				{Movies: `90's slashers, epic fantasies, the occasional tearjerker.`},
				{Television: `Mostly for background while gaming or sewing.`},
				{Books: `Supernatural detective stories are my guilty pleasure.`},
				{Heroes: `Cassandra Pentaghast, Haurchefant Greystone, Olivier Mira Armstrong`}
			],
		}
	  };
	}

	render (){
		const user = this.state.user;

		const PhotoBox = () => {
			return (
				<div className={styles.profile_pic}>
					<span className={styles.h1}>{user.name.first}</span>
					<div className={
						styles.d_flex 
						+ " " + 
						styles.flex_Row 
						+ " " + 
						styles.space_between 
						+ " " + 
						styles.panels}
					>
						<div className={styles.left_panel}>
							<img 
								src={user.photo}
								alt={user.name.first + "'s profile photo"}
							/>
						</div>
						<div className={styles.right_panel}>
							<div className={styles.row}>
								"{user.quote}"
							</div>
							<div className={styles.row}>
								{user.pronouns}
								<br />
								{user.age} years old
							</div>
							<div className={styles.row}>
								{user.location}
							</div>
							<div className={styles.row}>
								Last updated: today
							</div>
						</div>
					</div>
					<a href={user.website}>View more pics</a>
				</div>
			)
		}

		const ContactBox = () => {
			return(
				<div className={styles.contact}>
					<h2>Contacting {user.name.first}</h2>
					<table>
						<tbody>
							<tr>
								<th>
									Email
								</th>
								<td>
									<a href={"mailto:" + user.email}>
										Send Message
									</a>
								</td>
								<th>
									Current Website
								</th>
								<td>
									<button
										type="button"
										className={styles.btnAsLink}
										onClick={() => {
											window.navigator.clipboard.writeText(window.location.href);
										}}
										aria-label="Click to copy url and share it."
									>
										Forward to friend
									</button>
								</td>
							</tr>
							{/**
							<tr>
								<th>

								</th>
								<td>
									Add to Friends
								</td>
								<th>Bookmark</th>
								<td>
									<button
										type="button"
										onClick={() => {
											//print resume
										}}
									>
										Add to Favorites
									</button>
								</td>
							</tr>
							<tr>
								<th></th>
								<td>Instant Message</td>
								<th>Block website</th>
								<td>
									<button
										type="button"
										onClick={() => {
											//pop module asking if user wants to request deblock lint via email
											//send email
											//add ip to blocklist
										}}
									>Block User
									</button>
								</td>
							</tr>
							<tr>
								<th></th>
								<td>
									<a href="local">Add to Group</a>
								</td>
								<th>Click to be navigated to a review site</th>
								<td>
									<button 
										onClick={() => {
											// navigate to social site
										}}
									>
